import styled from "styled-components";
export const Conatainer=styled.div`
display: flex;
justify-content: space-between;
flex-direction: row;
padding: 30px 0px 34px;
`

//logo tip qismi
export const Logotip=styled.div`
display: flex;
flex-direction: row;
align-items: center;
`
export const Logo=styled.img`
width: 31px;
height: 39px;
margin-right: 5.2px;
`

export const LogoTitle=styled.div`
font-family: Rubik;
font-style: normal;
font-weight: 500;
font-size: 24px;
line-height: 28px;
color: #555555;
`

//search qimi
export const Search=styled.div`
display: flex;
flex-direction:row;
align-items: center;
width: 582px;
height: 46px;
left: 402px;
top: 71px;
border: 2px solid #7AC751;
box-sizing: border-box;
border-radius: 8px;
`
export const Input=styled.input`
width: 70%;
height: 100%;
outline: none;
border: none;
padding: 1px;
text-indent: 25px;
font-family: Rubik;
font-style: normal;
font-weight: normal;
font-size: 14px;
line-height: 17px;
/* identical to box height */


color: #B0B0B0;
`






